# 211. Design Add and Search Words Data Structure

class WordDictionary:

    def __init__(self):
        self.prefix_tree = [[False, None]]
        

    def addWord(self, word: str) -> None:
        cursor = self.prefix_tree
        li = 0
        for c in word:
            if cursor[li][1] == None:
                cursor[li][1] = []
                for i in range(26):
                    cursor[li][1].append([False, None])
            cursor = cursor[li][1]
            li = ord(c)-97
        cursor[li][0] = True

    def search(self, word: str) -> bool:
        cursor = self.prefix_tree[0][1]
        if cursor:
            return self.search_sub(word, 0, cursor)
        return False


    def search_sub(self, word, i, cursor) -> bool:
        c = word[i]
        if c == '.':
            if i == len(word) - 1:
                for ci in range(26):
                    if cursor[ci][0] == True:
                        return True
                return False
            else:
                for ci in range(26):
                    if cursor[ci][1] != None:
                        if self.search_sub(word, i+1, cursor[ci][1]) == True:
                            return True
                return False
        else:
            ci = ord(c)-97

            if i == len(word) - 1:
                return cursor[ci][0]
            else:
                if cursor[ci][1] == None:
                    return False
                else:
                    return self.search_sub(word, i+1, cursor[ci][1])


